import Login from './Components/Login'
import Newuser from './Components/Newuser'
import Welcome from './Components/Welcome'
import './App.css';
import {BrowserRouter as Router,Route,Switch} from 'react-router-dom';

function App() {
  return (
    <Router>
    <div className="App">
      <Switch>
        <Route path="/">
          <Welcome/>
        </Route>
        <Route path="/login">
        <Login/>
        </Route>
        <Route path="/newuser">
        <Newuser/>
        </Route>
      </Switch>
    </div>
    </Router>
  );
}

export default App;
